import React, { useState ,useEffect } from 'react';
import api from '../../services/api';

export default function ProjectPage()
{
    const [project,setProject] = useState({});
    const id = localStorage.getItem("projectID");
    
    useEffect(() => {
        api.get('project', {
            headers: {
                id: id,
            }
        }).then(response => {
            setProject(
                {
                    id: response.data[0].id
                }
                );
            console.log(project);
        })
    }, [id]);

    return(
        <div>
            <h1></h1>       
        </div>

    )
}
